
package adventofcode2018;

import java.util.ArrayList;
import java.util.LinkedList;
import java.util.List;
import java.util.ListIterator;
import java.util.OptionalInt;
import java.util.concurrent.TimeUnit;
import java.util.stream.IntStream;

import com.google.common.base.Stopwatch;

public class Day5 {

    public static void main(String[] args) {
    	
    	// part 1
    	Stopwatch stopwatch = Stopwatch.createStarted();   	
    	System.out.println(reactPolymerLinkedListWithIterator(input));	
    	System.out.println(stopwatch.elapsed(TimeUnit.MILLISECONDS));
    	
    	stopwatch = Stopwatch.createStarted();
    	reactPolymerArrayList(); 
    	System.out.println(stopwatch.elapsed(TimeUnit.MILLISECONDS));
    	
    	// part 2
    	OptionalInt min = IntStream.range('a', 'z').map(e -> {
    		String newString = input.replaceAll(Character.toString((char) e), "").replaceAll(Character.toString((char) e).toUpperCase(), "");
			return reactPolymerLinkedListWithIterator(newString);
    	}).min();
    	System.out.println(min);
    }

	private static void reactPolymerArrayList() {
		List<Integer> list = new ArrayList<>();
    	input.chars().forEach(list::add);
    	
    	for(int i = 0; i < list.size() - 1;) {
    		int first = list.get(i);
    		int second = list.get(i + 1);
    		if(Math.abs(first - second) == 32) {
    			list.remove(i);
    			list.remove(i);
    			if(i > 0) i--;
    		}
    		else {
    			i++;
    		}
    	}
    	System.out.println(list.size());
	}
    
    private static int reactPolymerLinkedListWithIterator(String inputString) {
    	
    	List<Integer> list = new LinkedList<>();
    	inputString.chars().forEach(list::add);
    	
    	ListIterator<Integer> listIterator = list.listIterator();
    	while(listIterator.hasNext() ) {
    		int first = listIterator.next();
    		if(!listIterator.hasNext()) break; // end of list
    		int second = listIterator.next();
    		if(Math.abs(first - second) == 32) {
    			listIterator.remove();
    			listIterator.previous();
    			listIterator.remove();
    			if(listIterator.hasPrevious()) listIterator.previous();
    		} 
    		else {
    			if(listIterator.hasPrevious()) listIterator.previous();
    		}
    	}
    	return list.size();
    	
    }
    
    private final static String input = "";
}
